数あるツイードの中でももっとも品質がよく、丈夫で、なおかつ発色の美しい生地として世界中にしられています。<br>
スコットランド北西に位置するアウターへイプリディーズ諸島のハリス地方で伝統ある職人の手によって織られるものだけを<br>
特にハリス・ツイードと呼び、厳しい品質基準をクリアした生地は、1909年設立の英国ハリス・ツイード協会（ロンドン）より、<br>
英国王室から使用が許可された宝珠の入ったマークがつけられます。<br><br>
